import React from "react";
import { useParams } from "react-router-dom";

const DayPage = () => {
    const {day} = useParams()
    const time = []
    for (let index = 0; index < 24; index+=1) {
        for (let i = 0; i < 60; i+=15) {
            time.push(`${index}:${i}`)
        }
    }
    return(
        <>
            {day}
        </>
    )
}

export default DayPage
